CREATE TABLE cycle_time (
   report_uid UUID,
   downtime_id INT,
   breakdown_id INT,
   manufacture_defect BOOLEAN,
   remarks TEXT NOT NULL,
   start_time TIMESTAMP WITHOUT TIME ZONE NOT NULL,
   end_time TIMESTAMP WITHOUT TIME ZONE NOT NULL,
   ring_number INT NOT NULL,
   tbm_status_id INT,
   id INT GENERATED ALWAYS AS IDENTITY,
   PRIMARY KEY (id)
);


ALTER TABLE cycle_time ADD CONSTRAINT report_uid FOREIGN KEY (report_uid) REFERENCES shift_report(report_uid) ON DELETE CASCADE;
ALTER TABLE cycle_time ADD CONSTRAINT downtime_id FOREIGN KEY (downtime_id) REFERENCES downtime(downtime_id) ON DELETE CASCADE;
ALTER TABLE cycle_time ADD CONSTRAINT breakdown_id FOREIGN KEY (breakdown_id) REFERENCES breakdown(breakdown_id) ON DELETE CASCADE;
ALTER TABLE cycle_time ADD CONSTRAINT tbm_status_id FOREIGN KEY (tbm_status_id) REFERENCES shift_tbm_status(tbm_status_id) ON DELETE CASCADE;